// SPDX-License-Identifier: MIT
pragma solidity ^0.6.0;

import '@openzeppelin/contracts/token/ERC20/IERC20.sol';
import '@openzeppelin/contracts/token/ERC20/SafeERC20.sol';
import '@openzeppelin/contracts/token/ERC20/SafeERC20.sol';
import './libraries/AdminRole.sol';
import './libraries/Safe112.sol';
import './libraries/ContractGuard.sol';

/**
 * @title 
 */
contract GOTWrapper {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;
    /// @notice GoSwap Token
    IERC20 public GOT;
    /// @dev 
    uint256 private _totalSupply;
    /// @dev 
    mapping(address => uint256) private _balances;

    /**
     * @dev 
     * @return 
     */
    function totalSupply() public view returns (uint256) {
        return _totalSupply;
    }

    /**
     * @dev 
     * @param account 
     * @return 
     */
    function balanceOf(address account) public view returns (uint256) {
        return _balances[account];
    }

    /**
     * @dev GOTBoardroom
     * @param amount 
     */
    function stake(uint256 amount) public virtual {
        // 
        _totalSupply = _totalSupply.add(amount);
        // 
        _balances[msg.sender] = _balances[msg.sender].add(amount);
        // GOT
        GOT.safeTransferFrom(msg.sender, address(this), amount);
    }

    /**
     * @dev BoardroomGOT
     * @param amount 
     */
    function withdraw(uint256 amount) public virtual {
        // 
        uint256 directorShare = _balances[msg.sender];
        // 
        require(directorShare >= amount, 'Boardroom: withdraw request greater than staked amount');
        // 
        _totalSupply = _totalSupply.sub(amount);
        // 
        _balances[msg.sender] = directorShare.sub(amount);
        // GOT
        GOT.safeTransfer(msg.sender, amount);
    }
}

/**
 * @title GoSwap Cash Boardroom
 * 
 * 1.GOTBoardroomBoardroomGOT
 * 2.EpochAdminGOC(Treasury)
 * GOCGOTBoardroom
 * TimBear 20210107
 */
contract Boardroom is GOTWrapper, ContractGuard, AdminRole {
    using SafeERC20 for IERC20;
    using Address for address;
    using SafeMath for uint256;
    using Safe112 for uint112;

    /* ========== DATA STRUCTURES ========== */

    /// @notice 
    struct Boardseat {
        uint256 lastSnapshotIndex; // 
        uint256 rewardEarned; // 
    }

    /// @notice 
    struct BoardSnapshot {
        uint256 time; // 
        uint256 rewardReceived; // 
        uint256 rewardPerShare; // 
    }

    /* ========== STATE VARIABLES ========== */
    /// @dev GoSwap Cash
    IERC20 private GOC;

    /// @dev ()
    mapping(address => Boardseat) private directors;
    /// @dev 
    BoardSnapshot[] private boardHistory;

    /* ========== CONSTRUCTOR ========== */

    /**
     * @dev 
     * @param _GOC GoSwap Cash
     * @param _GOT GoSwap Token
     */
    constructor(IERC20 _GOC, IERC20 _GOT) public {
        GOC = _GOC;
        GOT = _GOT;
        // 
        BoardSnapshot memory genesisSnapshot =
            BoardSnapshot({time: block.number, rewardReceived: 0, rewardPerShare: 0});
        //
        boardHistory.push(genesisSnapshot);
    }

    /* ========== Modifiers =============== */
    /// @notice Boardroom0
    modifier directorExists {
        require(balanceOf(msg.sender) > 0, 'Boardroom: The director does not exist');
        _;
    }

    /// @notice (GOC)
    /// @param director 
    modifier updateReward(address director) {
        // 0
        if (director != address(0)) {
            // 
            Boardseat memory seat = directors[director];
            //  = 
            seat.rewardEarned = earned(director);
            //  = -1
            seat.lastSnapshotIndex = latestSnapshotIndex();
            // 
            directors[director] = seat;
        }
        _;
    }

    /* ========== VIEW FUNCTIONS ========== */

    // =========== Snapshot getters
    // 
    /**
     * @dev 
     * @return 
     */
    function latestSnapshotIndex() public view returns (uint256) {
        // -1
        return boardHistory.length.sub(1);
    }

    /**
     * @dev 
     * @return 
     */
    function getLatestSnapshot() internal view returns (BoardSnapshot memory) {
        return boardHistory[latestSnapshotIndex()];
    }

    /**
     * @dev id
     * @param 
     * @return id
     */
    function getLastSnapshotIndexOf(address director) public view returns (uint256) {
        return directors[director].lastSnapshotIndex;
    }

    /**
     * @dev id
     * @param 
     * @return 
     */
    function getLastSnapshotOf(address director) internal view returns (BoardSnapshot memory) {
        return boardHistory[getLastSnapshotIndexOf(director)];
    }

    // =========== Director getters

    /**
     * @dev 
     * @return 
     */
    function rewardPerShare() public view returns (uint256) {
        return getLatestSnapshot().rewardPerShare;
    }

    /**
     * @dev (GOC)
     * @param 
     * @return GOC
     */
    function earned(address director) public view returns (uint256) {
        // 
        uint256 latestRPS = rewardPerShare();
        // id
        uint256 storedRPS = getLastSnapshotOf(director).rewardPerShare;

        //      (GOTGOC
        //    - GOTGOC)
        //    x GOT
        //    + 
        //---------------------------------
        //      
        return balanceOf(director).mul(latestRPS.sub(storedRPS)).div(1e18).add(directors[director].rewardEarned);
    }

    /* ========== MUTATIVE FUNCTIONS ========== */

    /**
     * @dev GOTBoardroom
     * @param amount 
     */
    function stake(uint256 amount) public override onlyOneBlock updateReward(msg.sender) {
        // 0
        require(amount > 0, 'Boardroom: Cannot stake 0');
        // 
        super.stake(amount);
        //
        emit Staked(msg.sender, amount);
    }

    /**
     * @dev BoardroomGOT
     * @param amount 
     */
    function withdraw(uint256 amount) public override onlyOneBlock directorExists updateReward(msg.sender) {
        // 0
        require(amount > 0, 'Boardroom: Cannot withdraw 0');
        // 
        super.withdraw(amount);
        //
        emit Withdraw(msg.sender, amount);
    }

    /**
     * @dev BoardroomGOT
     */
    function exit() external {
        // 
        withdraw(balanceOf(msg.sender));
        // 
        claimReward();
    }

    /**
     * @dev BoardroomGOC
     * @notice (GOC)
     */
    function claimReward() public updateReward(msg.sender) {
        //
        uint256 reward = directors[msg.sender].rewardEarned;
        // 0
        if (reward > 0) {
            //0
            directors[msg.sender].rewardEarned = 0;
            // 
            GOC.safeTransfer(msg.sender, reward);
            //
            emit RewardPaid(msg.sender, reward);
        }
    }

    /**
     * @dev GOTGOCAdmin
     * @param amount 
     * @notice EpochGOCAdmin,Treasury
     */
    function allocateSeigniorage(uint256 amount) external onlyOneBlock onlyAdmin {
        // 0
        require(amount > 0, 'Boardroom: Cannot allocate 0');
        // 0
        require(totalSupply() > 0, 'Boardroom: Cannot allocate when totalSupply is 0');

        //  = 
        uint256 prevRPS = rewardPerShare();
        //  =   +  * 1e18 / 
        uint256 nextRPS = prevRPS.add(amount.mul(1e18).div(totalSupply()));
        //()Epoch()
        // 
        BoardSnapshot memory newSnapshot =
            BoardSnapshot({
                time: block.number, // 
                rewardReceived: amount, // 
                rewardPerShare: nextRPS // 
            });
        //
        boardHistory.push(newSnapshot);

        //GOCAdmin
        GOC.safeTransferFrom(msg.sender, address(this), amount);
        //GOC
        emit RewardAdded(msg.sender, amount);
    }

    /**
     * @dev 
     * @param _token Token
     * @param _amount 
     * @param _to 
     * @notice 
     */
    function governanceRecoverUnsupported(
        IERC20 _token,
        uint256 _amount,
        address _to
    ) external onlyAdmin {
        // do not allow to drain core tokens
        require(address(_token) != address(GOC), 'GOC');
        require(address(_token) != address(GOT), 'GOT');
        _token.safeTransfer(_to, _amount);
    }

    /* ========== EVENTS ========== */
    /**
     * @dev : 
     * @param user 
     * @param amount 
     */
    event Staked(address indexed user, uint256 amount);
    /**
     * @dev : 
     * @param user 
     * @param amount 
     */
    event Withdraw(address indexed user, uint256 amount);
    /**
     * @dev : 
     * @param user 
     * @param reward 
     */
    event RewardPaid(address indexed user, uint256 reward);
    /**
     * @dev : 
     * @param user 
     * @param reward 
     */
    event RewardAdded(address indexed user, uint256 reward);
}
